import React from 'react';
import './About.css';

const About = () => {
  return (
    <section id="about" className="about">
      <h1 className="about_h">About <span>Us</span></h1>
      <div className="row">
        <div className="img">
          <img src="../../asserts/e3.jpeg'" alt="About" />
        </div>
        <div className="content">
          <h1>Our Mission <span>Statement</span></h1>
          <p>We are committed to delivering the best event management services...</p>
        </div>
      </div>
    </section>
  );
};

export default About;
